  false,\n\t\"url\": null,\n\t\"notes\": \"Seaglider data gathered as part of the
  Sustained Ocean Observations for Improving Atlantic Tropical Cyclone Intensity and
  Hurricane Seasonal Forecast project funded by the Disaster Relief Appropriations
  Act of 2013.nnThe National Centers for Environmental Information (NCEI) received
  the data in this archival package from the Integrated Ocean Observing System's National
  Glider Data Assembly Center (IOOS NGDAC). The IOOS NGDAC received the data in one
  or more netCDF files comprising an entire glider deployment. The data are measurements
  of physical oceanographic properties such as temperature, salinity, conductivity,
  and density. The IOOS NGDAC checked the files for compliance to their netCDF file
  convention, aggregated the files into a single netCDF file, and then submitted the
  file to NCEI for long-term preservation.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
